import react from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import './teams.css'

function Team({ team1, matches, wins, loses, draws }) {

}

export default function TeamsPage({ isAdmin }) {
    const navigate = useNavigate();
    function handleClickTeams() {
        navigate('/teams')
    }
    function handleClickMatches() {
        navigate('/matches')
    }
    function handleClickTables() {
        navigate('/tables')
    }

    function handleLogout() {
        sessionStorage.removeItem("accessToken");
        sessionStorage.removeItem("refreshToken");
        localStorage.removeItem("isAdmin");
        navigate('/login');
    }

    return (
        <>
            <div className="content-teams">
                <div className="container-teams">
                    <header className='header'>
                        <h2 className='logo'>Sportify</h2>
                        <div className='nav'>
                            <ul>
                                <li onClick={handleClickTeams
                                }>Teams</li>
                                <li onClick={handleClickMatches}>Matches</li>
                                <li onClick={handleClickTables}>Tables</li>
                            </ul>
                        </div>
                        {isAdmin && (
                            <button class="button-4" role="button" onClick={handleLogout}>Logout</button>
                        )}
                    </header>
                    <form>
                        <label>Name of the Team</label>
                        <input className="team-name" placeholder="Team" type="text" />
                        <div className="players-input">
                            <div className="input-row">
                                <div className="input-group">
                                    <label>Player 1</label>
                                    <input placeholder="Player 1" type="text" />
                                </div>
                                <div className="input-group">
                                    <label>Player 2</label>
                                    <input placeholder="Player 2" type="text" />
                                </div>
                                <div className="input-group">
                                    <label>Player 3</label>
                                    <input placeholder="Player 3" type="text" />
                                </div>
                            </div>
                            <div className="input-row">
                                <div className="input-group">
                                    <label>Player 4</label>
                                    <input placeholder="Player 4" type="text" />
                                </div>
                                <div className="input-group">
                                    <label>Player 5</label>
                                    <input placeholder="Player 5" type="text" />
                                </div>
                                <div className="input-group">
                                    <label>Player 6</label>
                                    <input placeholder="Player 6" type="text" />
                                </div>
                            </div>
                            <div className="input-single">
                                <div className="input-group">
                                    <label>Player 7</label>
                                    <input placeholder="Player 7" type="text" />
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </>
    );
}
